    function setup() {
      return {
        input: ["red","green","nir", "dataMask"],
        output: { bands: 4 }
      };
    }
    const visualizer = new HighlightCompressVisualizer(0.1, 0.7)

    function evaluatePixel(sample) {
     return [visualizer.process(sample.nir / 2000),
              visualizer.process(sample.red / 2000),
              visualizer.process(sample.green / 2000), sample.dataMask ];
    }

//VERSION=3
    function setup() {
      return {
        input: [{
          bands: [
            "red",
            "nir",
            "dataMask"
          ]
        }],
        output: [
          { id: "default", bands: 4 },
          { id: "index", bands: 1, sampleType: "FLOAT32" },
          { id: "eobrowserStats", bands: 1 },
          { id: "dataMask", bands: 1 },
        ]
      }
    }

    function evaluatePixel(samples) {

    let ndvi = (samples.nir - samples.red)/(samples.nir + samples.red);
    const indexVal = samples.dataMask === 1 ? ndvi : NaN;
    let imageVals = valueInterpolate(ndvi,
      [0.0, 0.5, 1.0],
      [
        [1,0,0, samples.dataMask], 
        [1,1,0,samples.dataMask], 
        [0.1,0.31,0,samples.dataMask], 
      ]);

    return {
      default: imageVals,
      index: [indexVal],
      eobrowserStats:[ndvi],
      dataMask: [samples.dataMask],
    };
    }

